import React from 'react';
import './Dashboard.css';
import { FaWalking, FaDumbbell, FaHeartbeat, FaSpa, FaNotesMedical } from 'react-icons/fa';

const exercises = {
  WarmUp: ['Neck Rolls', 'Shoulder Shrugs', 'Arm Circles'],
  Strength: ['Squats', 'Lunges', 'Push-ups'],
  Flexibility: ['Hamstring Stretch', 'Quad Stretch', 'Calf Stretch'],
  Physiotherapy: ['Wrist Flexion', 'Ankle Circles', 'Elbow Extension'],
  Tips: ['Stay hydrated', 'Take rest', 'Maintain posture'],
};

const Dashboard = () => {
  const cards = [
    {
      title: 'Warm Up',
      icon: <FaWalking />,
      list: exercises.WarmUp,
      color: '#ff7f50',
    },
    {
      title: 'Strength Training',
      icon: <FaDumbbell />,
      list: exercises.Strength,
      color: '#6a5acd',
    },
    {
      title: 'Flexibility',
      icon: <FaSpa />,
      list: exercises.Flexibility,
      color: '#20b2aa',
    },
    {
      title: 'Physiotherapy',
      icon: <FaHeartbeat />,
      list: exercises.Physiotherapy,
      color: '#e6739f',
    },
    {
      title: 'Rehab Tips',
      icon: <FaNotesMedical />,
      list: exercises.Tips,
      color: '#008080',
    },
  ];

  return (
    <div className="dashboard-container">
      <header className="dashboard-header">
        <h1>AI Rehab Dashboard</h1>
      </header>
      <div className="dashboard-main">
        {cards.map((card, index) => (
          <div className="dashboard-card" style={{ backgroundColor: card.color }} key={index}>
            <div className="icon">{card.icon}</div>
            <h2>{card.title}</h2>
            <ul>
              {card.list.map((item, idx) => (
                <li key={idx}>{item}</li>
              ))}
            </ul>
            <button className="start-button">Start</button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Dashboard;
